import {
    ThemeProvider, 
    theme, 
    ColorModeProvider, 
    CSSReset,
} from '@chakra-ui/react'
import Toggle from './Toggle';


function App() {
  return (
    <ThemeProvider theme={theme}>
      <ColorModeProvider options={{
        useSystsemColorMode: true
      }}>
        <CSSReset/>
        <Toggle />
      </ColorModeProvider>
    </ThemeProvider>
  );
}

export default App;
